      "pembahasan": "<p><span style=\"font-weight: 400;\">Berdasarkan ciri: Bersimetri radial dan hidup di laut, maka hewan tersebut merupakan kelompok filum Echinodermata.</span></p>\n<p><span style=\"font-weight: 400;\">Adapun berbagai ciri kelas dari Echinodermata antara lain :</span></p>\n<p>&nbsp;</p>\n<p><span style=\"font-weight: 400; background-color: #bfedd2;\">Ophiuroidea</span></p>\n<p><span style=\"font-weight: 400;\">Ophiuroidea adalah kelompok yang berbentuk bintang pisin pusat kecil (1-3 cm) dan memiliki lima lengan yang panjang dan langsing, yang terkadang bercabang-cabang. Ophiruoidea disebut sebagai <span style=\"background-color: #bfedd2;\">bintang mengular atau bintang ular laut.</span></span></p>\n<p>&nbsp;</p>\n<p><span style=\"background-color: #fbeeb8;\"><strong>Echinoidea</strong></span></p>\n<p><span style=\"font-weight: 400;\">Echinoidea dikenal sebagai<span style=\"background-color: #fbeeb8;\"> bulu babi atau dolar pasir</span>. Echinoidea memiliki bentuk tubuh bulat seperti bola atau pipih bundar seperti uang logam. Echinoidea tidak memiliki lengan namun mempunyai duri-duri yang dapat digerakkan. Echinoidea bergerak dengan kaki tabung dan duri-duri. (Sesuai ciri-ciri)</span></p>\n<p>&nbsp;</p>\n<p><span style=\"background-color: #f8cac6;\"><strong>Asteroidea</strong></span></p>\n<p><span style=\"font-weight: 400;\">Asteroidea adalah kelompok <span style=\"background-color: #f8cac6;\">bintang laut</span> karena bentuknya seperti bintang dengan lima lengan yang besar.</span></p>\n<p>&nbsp;</p>\n<p><span style=\"background-color: #eccafa;\"><strong>Crinoidea</strong></span></p>\n<p><span style=\"font-weight: 400;\">Crinoidea dikenal sebagai<span style=\"background-color: #eccafa;\"> lili laut </span>karena bentuk tubuhnya bertangkai mirip bunga lili. Tubuh Crinoidea terdiri atas kelopak (kaliks) berbentuk mangkuk kecil dari pelat-pelat kapur dan lima buah lengan yang bagian pangkalnya bercabang sehingga tampak berjumlah 10 lengan atau lebih.</span></p>\n<p>&nbsp;</p>\n<p><span style=\"background-color: #c2e0f4;\"><strong>Holothuroidea</strong></span></p>\n<p><em><span style=\"font-weight: 400;\">Holothuroidea</span></em><span style=\"font-weight: 400;\"> dikenal sebagai <span style=\"background-color: #c2e0f4;\">mentimun (sea cucumber) laut atau tripang</span>, tubuh mentimun laut memanjang sepanjang sumbu oral sampai aboral sehingga memberikan bentuk mentimun seperti namanya. Tubuh bulat memanjang tertutupi oleh kulit yang berkutikula dan tidak bersilia.</span></p>\n<p>&nbsp;</p>\n<p><span style=\"font-weight: 400;\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://drive.tiny.cloud/1/wq1y26f7fjwtm2n5ovqw4c2egh0tl1bend35s56qt33anui5/a8987632-cd13-4ed2-815a-c3cb0425811f\" /></span></p>",
